               </Form.Text>
             </Form.Group>
             <Form.Group className="mb-3" controlId="formBasicCheckbox">
               <Form.Check type="checkbox" label="Remember me" />
             </Form.Group>
             {['Log In','Facebook','Google','Twitter'].map((label)=>(
               <Button className='w-100 mb-2'>
                 {label}
               </Button>
               )
             )}
           </Form>
          </Card>
        </CardWrap>
      </CardPageWrap>
    </div>
  )
}


